pragma solidity ^0.4.10;

import "./EximchainIdentityRegistryDeployable.sol";

/**
  # VOTE INTEGER SIZE DECISIONS

  This governance contract has a number of optimizations built specifically for 
  the Exim blockchain.  These optimizations are based on:
    1. Quadratic voting system where voting v costs v**2 tokens
    2. A total token supply for 150M tokens
    3. Minimum requirement of 500 tokens to cast vote
  This leads to:

  - MAX SINGLE VOTE (uint16): Maximum vote is sqrt(150M)=12,247. Each 
    BallotRecord stores the vote as a uint16, which handles up to 65,536.

  - MAX TOTAL VOTE (int24): Atleast one person needs to be nominated by a voter, that voter 
    must hold 500 tokens and casts 32 votes (for 1024 tokens)for the nomination leaving: 
    150M - 500 - 1024 = 149998476 tokens in circulation. Each voter thereafter must also hold 500 tokens 
    and can cast a minimum of 1 vote with 1 token.  and  so at a max supply of 149998476, the max number 
    of votes any candidate can receive in an election is 32 + 149998476/501=299k votes, either positive or 
    negative. The nominee and governance ballots store this in the smallest 
    possible int, int24 (maxes at +/-8.35M).

  - MAX AMOUNT (uint32): If somebody held every token and used every one to vote, 
    the amount for that vote would be 150M.  The BallotRecord and NomineeBallot 
    store the amount as a uint32, the smallest uint which can hold 150M (maxes at 4.29B).

 */

contract WeylGovV2Deployable is EximchainIdentityRegistryDeployable {

  ////////////////////////////////
  // GOVERNANCE CYCLES
  ////////////////////////////////

  uint8 constant GovernanceCycleNoRecord = 0;
  uint8 constant GovernanceCycleStarted = 1;
  uint8 constant GovernanceCycleCompleted = 2;
  uint256 public constant GovernanceCycleDelay = (60 seconds);

  enum GovernanceCycleStatus {
      NoRecord,
      Started,
      Completed
  }

  struct GovernanceCycle{
    uint32 totalPayments;
    uint8 status;
    int24 electionVotesElected;
    int24 evictionVotesEvicted;
    uint24 totalVoters;
    uint[] ballotIds;
    address elected;
    address evicted;
    uint256 start;
  }

  mapping(uint => GovernanceCycle) public governanceCycleRecords;
  uint public currentGovernanceCycle;

  event CycleStarted(uint256 cycleId);
  event CycleFinalized(uint256 cycleId);
  function newGovernanceCycle() public {
    populateGovernanceCycleRecord();
    emit CycleStarted(currentGovernanceCycle);
  }

  function findWinners() public constant returns (address, int24, address, int24) {
    address electionWinner = address(0);
    int24 electionWinnerCount = 0;
    address evictionWinner = address(0);
    int24 evictionWinnerCount = 0;
    for (uint16 i = 0; i < nomineesInCycle; i++){
      if (nomineeBallots[nomineeBallotKeys[i]].election){
        if (nomineeBallots[nomineeBallotKeys[i]].votes > electionWinnerCount){
          electionWinner = nomineeBallotKeys[i];
          electionWinnerCount = nomineeBallots[nomineeBallotKeys[i]].votes;
        }
      } else {
        if (nomineeBallots[nomineeBallotKeys[i]].votes > evictionWinnerCount){
          evictionWinner = nomineeBallotKeys[i];
          evictionWinnerCount = nomineeBallots[nomineeBallotKeys[i]].votes;
        }
      }
    }
    return (electionWinner, electionWinnerCount, evictionWinner, evictionWinnerCount);
  }

  function finalizeGovernanceCycle() public {
    GovernanceCycle storage latestGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
    require(latestGovernanceCycle.status==GovernanceCycleStarted);
    require(now >= latestGovernanceCycle.start + GovernanceCycleDelay);
    address electionWinner;
    address evictionWinner;
    int24 electionWinnerCount;
    int24 evictionWinnerCount;
    (electionWinner, electionWinnerCount, evictionWinner, evictionWinnerCount) = findWinners();
    latestGovernanceCycle.elected = electionWinner;
    latestGovernanceCycle.electionVotesElected = electionWinnerCount;
    latestGovernanceCycle.evicted = evictionWinner;
    latestGovernanceCycle.evictionVotesEvicted = evictionWinnerCount;
    latestGovernanceCycle.status = GovernanceCycleCompleted;
    executeGovernance();
    nomineesInCycle = 0;
    emit CycleFinalized(currentGovernanceCycle);
  }

  event AddedBlockMaker(address newMaker, uint256 cycleId);
  event RemovedBlockMaker(address oldMaker, uint256 cycleId);
  function executeGovernance() private {
    require(governanceCycleRecords[currentGovernanceCycle].status == GovernanceCycleCompleted);
    address electedBlockMaker = governanceCycleRecords[currentGovernanceCycle].elected;
    address evictedBlockMaker = governanceCycleRecords[currentGovernanceCycle].evicted;
    if (electedBlockMaker != address(0)){
      consensus.addBlockMaker(electedBlockMaker);
      emit AddedBlockMaker(electedBlockMaker, currentGovernanceCycle);
    }
    if (evictedBlockMaker != address(0)){
      consensus.removeBlockMaker(evictedBlockMaker);
      emit RemovedBlockMaker(evictedBlockMaker, currentGovernanceCycle);
    }
  }

  function populateGovernanceCycleRecord() internal returns (GovernanceCycle storage record, uint256 index) {
    GovernanceCycle memory latestGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
    if (currentGovernanceCycle == 0 && latestGovernanceCycle.status == GovernanceCycleNoRecord){
      GovernanceCycle storage burnGovernanceCycle = governanceCycleRecords[currentGovernanceCycle];
      burnGovernanceCycle.status = GovernanceCycleCompleted;
      burnGovernanceCycle.start = now;
      return (record, index);
    } else {
      require(latestGovernanceCycle.status == GovernanceCycleCompleted);
      require(now >= latestGovernanceCycle.start + GovernanceCycleDelay);
      index = currentGovernanceCycle+1;
      record = governanceCycleRecords[index];
      require(record.status == GovernanceCycleNoRecord);
      record.status = GovernanceCycleStarted;
      record.start = now;
      currentGovernanceCycle ++;
      return (record, index);
    }

  }

  ////////////////////////////////
  // BALLOTS
  ////////////////////////////////

  struct BallotRecord {
        uint governanceCycleId;
        address voter;
        address voted_for;
        uint256 withdrawRecordId;
        uint256 timestamp;
        uint32 amount;
        uint16 votes;
        bool election;
        bool inSupport;
        bool withdrawRecord;
  }

  struct NomineeBallot{
    uint governanceCycleId;
    int24 votes;
    bool election;
    uint[] nominationsPastGovernanceCycles;
  }

  mapping(address => NomineeBallot) public nomineeBallots;
  address[] public nomineeBallotKeys;
  mapping (uint => BallotRecord) public ballotRecords;
  mapping (address => uint[]) public ballotHistory;
  mapping (address => uint) public latestGovernanceCycleParticipated;
  uint public ballotIndex;
  uint16 public constant maxNomineesInCycle = 1024;
  uint16 public nomineesInCycle;
  uint256 constant NominationFee = 1024;

  event Voted(address _voter, uint256 _ballotIndex, address _voted_for, bool _election, bool _inSupport, uint16 _votes);
  function vote(address _voted_for, bool _election, bool _inSupport, uint16 _votes) public payable returns (uint256 index){
    // Max supply is 150M "ether", so max vote is sqrt(150M)=12.2k. uint16 maxes at 65.3k. uint32 maxes at 4.2B.
    assert(msg.value < (150000000 * 1 ether));
    assert(_votes < 12247);
    // Casting each vote up to 32 bytes ensures we don't get an overflow
    require(msg.sender.balance > (500 * 1 ether));
    require(currentGovernanceCycle > 0);
    uint128 _amount = uint128(msg.value/1 ether);
    require(uint128(_votes)*uint128(_votes) <= _amount);
    require(nomineesInCycle < maxNomineesInCycle);
    require(canGovern(_voted_for));
    require(canGovern(msg.sender));
    require(_amount >= 1);

    BallotRecord memory record;
    (record, ballotIndex) = populateBallotRecord(_voted_for,  _election,  _inSupport,  uint32(_amount),  _votes);
    emit Voted(msg.sender, ballotIndex, _voted_for, _election, _inSupport, _votes);
    return ballotIndex;
  }

  function populateBallotRecord(address _voted_for, bool _election, bool _inSupport, uint32 _amount, uint16 _votes) internal returns (BallotRecord storage record, uint256 index) {
    // TEST SWTICH: Disabling below line allows multiple votes in one cycle from one voter.
    require (latestGovernanceCycleParticipated[msg.sender] < currentGovernanceCycle);
    require(canGovern(msg.sender));
    latestGovernanceCycleParticipated[msg.sender] = currentGovernanceCycle;

    index = ballotIndex+1;
    record = ballotRecords[index];

    GovernanceCycle storage governanceCycleRecord = governanceCycleRecords[currentGovernanceCycle];
    NomineeBallot storage nomineeBallotRecord = nomineeBallots[_voted_for];

    // This check shows that the vote for this nominee is the first one in this governanceCycle,
    // and is therefore a nomination.  Nominations (i.e. first vote in cycle for a candidate)
    // requires updates to both the nominee's ballot and the record of all nominations in cycle. 
    if (nomineeBallotRecord.governanceCycleId != currentGovernanceCycle) {
      require(_amount >= NominationFee);
      if (nomineeBallotKeys.length == nomineesInCycle){
        nomineeBallotKeys.push(_voted_for);
      } else {
        nomineeBallotKeys[nomineesInCycle] = _voted_for;
      }
      nomineesInCycle ++;
      nomineeBallotRecord.governanceCycleId = currentGovernanceCycle;
      nomineeBallotRecord.election = _election;
      nomineeBallotRecord.votes = 0;
      nomineeBallotRecord.nominationsPastGovernanceCycles.push(currentGovernanceCycle);
    } else if (_election == true) {
      // This clause is only reached for non-nominating votes, once the nomination has already
      // updated the nominee's ballot to this cycle.  In elections, only blockmakers can vote
      // on existing nominees.
      require(consensus.isBlockMaker(msg.sender));
    }

    // Verify the nominee has appropriate blockmaker status for election/eviction
    if (_election == true) {
      require(!consensus.isBlockMaker(_voted_for));
    } else {
      require(consensus.isBlockMaker(_voted_for));
    }
    require (nomineeBallotRecord.governanceCycleId == currentGovernanceCycle);
    require (governanceCycleRecord.status == GovernanceCycleStarted);

    record.governanceCycleId = currentGovernanceCycle;
    record.voter = msg.sender;
    record.voted_for = _voted_for;
    record.election = _election;
    record.inSupport = _inSupport;
    record.amount = _amount;
    record.votes = _votes;
    record.timestamp = now;

    // UPDATE NOMINEE BALLOT RECORDS
    // Each BallotRecord stores _votes as a uint16, but the NomineeBallot maintains
    // the running tally as an int24, so we convert the values before performing
    // math.  Important that we cast to an int24 rather than an int16, as an int16
    // only supports half the positive range that a uint16 does.
    if ( _election) {
      assert(nomineeBallotRecord.election == true);
      if (_inSupport) {
        nomineeBallotRecord.votes += int24(_votes);
      } else {
        nomineeBallotRecord.votes -= int24(_votes);
      }
    } else {
      assert(nomineeBallotRecord.election == false);
      if (_inSupport) {
        nomineeBallotRecord.votes += int24(_votes);
      } else {
        nomineeBallotRecord.votes -= int24(_votes);
      }
    }

    governanceCycleRecord.totalPayments += _amount;
    governanceCycleRecord.totalVoters += 1;
    ballotIndex++;
    ballotHistory[msg.sender].push(index);
    return (record, index);
  }

  ////////////////////////////////
  // WITHDRAWALS
  ////////////////////////////////

  //using SafeMath for uint256;
  uint8 constant WithdrawStatusNoRecord = 0;
  uint8 constant WithdrawStatusStarted = 1;
  uint8 constant WithdrawStatusCompleted = 2;
  uint256 public constant WithdrawDelay = (60 seconds);
  event WithdrawStartedEvent(uint256 _withdrawIndex,
                                address  _voter,
                                uint256 _governanceCycleId,
                                uint256 _ballotId);
  event WithdrawFinalizedEvent(uint256 _withdrawIndex,
                                address _voter,
                                uint256 _governanceCycleId,
                                uint256 _ballotId);

  enum WithdrawStatus {
      NoRecord,
      Started,
      Completed
  }

  struct WithdrawRecord {
      uint32 amount;
      uint8 status;
      uint governanceCycleId;
      address beneficiary;
      uint256 ballotId;
      uint256 timestamp;
  }

  mapping(uint => WithdrawRecord) public withdrawRecords;
  mapping (address => uint[]) public withdrawHistory;
  uint public withdrawRecordsIndex;

  function startWithdraw(uint _governanceCycleId, uint _ballotId) public returns(bool ok, uint index) {
    WithdrawRecord memory record;
    (record, index) = populateWithdrawRecord(_governanceCycleId, _ballotId);
    ok = true;
    emit WithdrawStartedEvent(index, msg.sender, _governanceCycleId, _ballotId);
    return (ok, index);
  }

  function populateWithdrawRecord(uint _governanceCycleId, uint _ballotId) internal returns (WithdrawRecord storage record, uint256 index) {
    GovernanceCycle memory governanceCycleRecord = governanceCycleRecords[_governanceCycleId];
    BallotRecord storage ballotRecord = ballotRecords[_ballotId];

    require(governanceCycleRecord.status == GovernanceCycleCompleted);
    require(ballotRecord.voter == msg.sender);
    require(ballotRecord.governanceCycleId == _governanceCycleId);
    require(ballotRecord.withdrawRecord == false);
    require(ballotRecord.withdrawRecordId == 0);

    index = withdrawRecordsIndex+1;
    record = withdrawRecords[index];

    ballotRecord.withdrawRecord = true;
    ballotRecord.withdrawRecordId = index;

    assert(record.status == WithdrawStatusNoRecord);

    record.status = WithdrawStatusStarted;
    record.governanceCycleId = _governanceCycleId;
    record.ballotId = _ballotId;
    record.beneficiary = msg.sender;
    record.amount = governanceCycleRecord.totalPayments / governanceCycleRecord.totalVoters;
    record.timestamp = now;

    withdrawRecordsIndex ++;
    withdrawHistory[msg.sender].push(index);
    return (record, index);
  }

  function finalizeWithdraw(uint256 _withdrawIndex) public returns(bool success) {
    WithdrawRecord storage record = withdrawRecords[_withdrawIndex];
    require(canGovern(msg.sender));
    require(record.status == WithdrawStatusStarted);
    require(now >= record.timestamp + WithdrawDelay);
    record.status = WithdrawStatusCompleted;
    record.timestamp = now;

    uint256 toSend = uint128(record.amount) * 1 ether;
    record.beneficiary.transfer(toSend);

    emit WithdrawFinalizedEvent(_withdrawIndex, record.beneficiary, record.governanceCycleId, record.ballotId);

    return true;
  }

}
